import{_ as e,p as t,q as a,a1 as s}from"./framework-78a42dfe.js";const l={},i=s('<h2 id="日记" tabindex="-1"><a class="header-anchor" href="#日记" aria-hidden="true">#</a> 日记</h2><p>这两天对面的房子来了个老婆儿， 人挺好的。 还没搬东西吧， 她说明天来带东西搬过来。 所以我今天晚上准备连接上热水器先洗个澡（因为从本质来讲， 热水器是他家里的， 使用应该跟他说一下。），她来了倒有些不太方便。</p><p>但是事情发展怎么说呢， 我从她家里插热水器的原因是我想要洗澡， 但是! 我妈因为要洗衣服，如果我直接洗的话，旁边还有个洗衣机，特别不太方便，我就准备晚一点洗。</p><p>吃完饭，上床睡觉前我就准备洗澡了。 找了半天的衣服，我妈告诉我热水器是凉的。 我就挺纳闷的， 我明明烧水了， 这时间也过去挺长时间了。 然后她说 他把<mark>热水器的线拔了</mark>， 就因为要洗衣裳。（ 平常都是直接拉线过去洗的）。 啊西巴 。</p><p>讲道理我挺不懂， 明明我之前就跟他说了，线我接上了，咱们一会能够洗澡。我本意就是用别人的水电，洗个澡就行了， 没必要在多余的地方使用他， 让别人发现了还败好感。 但是他是直接接洗衣机上了。就一个这东西，自己拉个线过去不就行了。为什么还要贪便宜到这种地步。</p><p>按我自己对她的了解来说吧。 她那个时代的确实是别人的东西没有一点留情，只要不是自己的东西， 就是随便用。反正不用自己花钱。 要是我自己我感觉自己会收敛很多。 为什么呢？ 她错了还是我错了? 嗯 ？ 我不理解， 是因为我在外面的为人处世的原因还是怎么？</p><p>我不想跟她一样 ，感觉有一种特别莫名其妙的情绪在我这里。 有点三观不合的恼怒？ （我确实很少回去陪三观不合的人在一块） 一切的种种包括以前的一些事在驱使我离开这里 。 我想走， 但我这阵子几乎没去招聘软件看了， 没找工作， 看来我得这几天努力努力的找工作了。我自己去住一个地方应该会好点吧。 大概吧， 我猜 。</p><p>还有一件事情。 这个博客貌似有点问题， 我应该去找找由React或者Vue其他组件库搭建的博客内容或者等待Vuepress2-plugin-blog的插件出来？<br> 这个代办项目暂时先放这里吧。</p><ul class="task-list-container"><li class="task-list-item"><input type="checkbox" class="task-list-item-checkbox" id="task-item-0" disabled="disabled"><label class="task-list-item-label" for="task-item-0"> 找个其他合适的博客地址</label></li></ul>',9),c=[i];function p(r,o){return t(),a("div",null,c)}const d=e(l,[["render",p],["__file","2023-4-10.html.vue"]]);export{d as default};
